  false,\n\t\"url\": null,\n\t\"notes\": \"This environmental assessment serves as
  the NEPA document which analyzes the impacts of the proposed changes to the hunting
  program at Minnesota Valley National Wildlife Refuge for 2011 and beyond. The Preferred
  Alternative, as presented in this EA, outlines proposed changes to the 2011 Hunting
  Chapter. Proposed uses within the 2011 Hunting Chapter have been determined to be
  appropriate and compatible with the mission of the Refuge System and purposes for
  which the Refuge was established.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
